    graph_fft.set_xticks(np.linspace(0,20000,11))
    graph_fft.set_xticks(np.linspace(-1000,21000,23),minor=True)
    graph_fft.set_yticks(np.linspace(-80,10,10))
    graph_fft.set_yticks(np.linspace(-80,10,19),minor=True)

    graph_fft.grid(which="major",alpha=0.6)
    graph_fft.grid(which="minor",alpha=0.3)

    graph_fft.set_title("Grafico FFT")
    graph_fft.set_xlabel("Frecuencia [Hz]")
    graph_fft.set_ylabel("Amplitud [dBV]")

